angular.module("keitoaino.ngTap",[]).directive("ngTap",function(){var e=!!("ontouchstart"in window);return function(t,n,r){if(e){var i=false;n.bind("touchstart",function(){i=true;n.addClass("tapped")});n.bind("touchmove",function(){i=false;n.removeClass("tapped")});n.bind("touchend",function(){i&&t.$apply(r.ngTap);n.removeClass("tapped")})}else n.bind("click",function(){t.$apply(r.ngTap)})}})
